description:
A detective from the year 2077 finds herself trapped in present day Vancouver and searching for ruthless criminals from the future.

Continuum is a Canadian science fiction series that centers on the conflict between a police officer and a group of rebels from the year 2077 who time-travel to Vancouver, BC in the year 2012. It premiered on Showcase on May 27, 2012.The first season will consist of 10 episodes. It is unknown if Continuum has or will be picked up for a second season.

